import React from 'react';
import Header from './component/Header'
import Main from './component/Main'
import Index from './srcc/components/Index'
import Footer from './component/Footer'

function App() {
  return (
    <div className="App">

    <Header />
    <Main />
    <Index />
    <Footer />
    </div>
  );
}

export default App;
